import React from 'react';

export default function Navbar() {
  return (
    <nav className="w-full py-4 px-6 flex justify-between items-center bg-white shadow-md">
      <a href="/" className="text-2xl font-bold text-decoration-none">SarrdehTech</a>
      <ul className="flex space-x-6">
        {['Home','About','Services','Portfolio','Blog','Contact'].map(label => (
          <li key={label}>
            <a href={`/${label.toLowerCase()}`} className="hover:text-teal-600 text-decoration-none">
              {label}
            </a>
          </li>
        ))}
      </ul>
    </nav>
  );
}
